export default props => {

    function criaTabela(){
        return users.map(user=>{
            return <tr key ={user.nome}>
                <td>
                    {user.nome}
                </td>
                <td>
                    {user.data}
                </td>

            </tr>
             
            
        })

    }

    return(
        {criaTabela}
    )
 

}
